eit‚Äù, ist es dir untersagt das Spiel zu beenden. Spielabst√ºrze sind davon nicht betroffen. </span><br />\r\n								<span>Vollmaskierte Spieler sind nicht an ihrer Stimme, Redensart oder Kleidungsstil zu erkennen.</span><br />\r\n								<span>Die offensichtliche Bedrohung mit einem gef√§hrlichen Gegenstand gilt als Schussank√ºndigung! Es muss aber aus der RP-Situation hervorgehen.</span><br />\r\n								<span>Es ist zwingend erforderlich ein funktionst√ºchtiges Mikrofon mit angemessener Qualit√§t zu verwenden. St√∂rger√§usche m√ºssen unmittelbar vor dem RP noch behoben werden.</span><br />\r\n								<span>Solltest du mitbekommen, dass ein Mitspieler gegen die Serverregeln verst√∂√üt, bist du verpflichtet die aktive Situation zu Ende zu spielen. Danach kannst du den Support, bestenfalls mit Videobeweis, dar√ºber informieren.</span><br />\r\n								<span>RP-Situationen, die durch einen Serverabsturz oder -neustart unterbrochen wurden, sind auszuspielen sobald der Server wieder l√§uft, das gleiche gilt f√ºr Spielabst√ºrze.</span>									\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<br />\r\n				<div style="padding:2px;width:100%;">\r\n					<div class="rules-item">\r\n						<h5>Staats Fraktionen (LSPD, LSMC etc.)</h5>\r\n						<div class="ti-content">\r\n							<div class="ti-text">\r\n								<span>Die Leitungen einer Staatlichen Fraktion (obersten zwei R√§nge), d√ºrfen aufgrund der Geltung ihrer F√ºhrungsposition, in keiner Weise korrupt sein.</span><br />\r\n								<span>Beim LSMC herrscht Korruptionsverbot.</span>									\r\n								</ul>\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<br />				\r\n				<div style="padding:2px;width:100%;">\r\n					<div class="rules-item">\r\n						<h5>Voice</h5>\r\n						<div class="ti-content">\r\n							<div class="ti-text">\r\n								<span>Dein TeamSpeak Nickname muss den Namen eures Charakters beinhalten, das gleiche gilt f√ºr den Discord Server.</span><br />\r\n								<span>Stimmverzerrer sind nicht gestattet. Ausnahme: Hinrichtungen, Suizid, Ausreisen</span><br />\r\n								<span>Es ist Pflicht, w√§hrend man InGame ist, auf dem TeamSpeak Server connected zu sein und sich im ‚ÄúInGame‚Äù-Channel aufzuhalten. Andere TeamSpeak-Server d√ºrfen w√§hrend der aktiven Zeit in den Channeln nicht genutzt werden. Ausnahme: AFK-Bereich</span><br />\r\n								<span>Andere Discord-Server f√ºr Informationsaustausch oder zur Nutzung eines ‚ÄúFunks‚Äù sind nicht gestattet. Ausnahme: Staatlicher Funk der mit dem Support abgesprochen wurde.</span><br />\r\n								<span>Beim Verbinden mit unserem Server erkl√§rst du dich damit einverstanden, dass der IngameVoiceChat aufgenommen und genutzt werden darf.</span><br />\r\n								</ul>\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<br />\r\n				<div style="padding:2px;width:100%;">\r\n					<div class="rules-item">\r\n						<h5>Charakter</h5>\r\n						<div class="ti-content">\r\n							<div class="ti-text">\r\n								<span>Jeder Charakter muss eine Hintergrundstory besitzen und diese m√ºsst ihr im RP passend abrufen k√∂nnt. Ein rasches Ab√§ndern der Herkunftsgeschichte ist verboten.</span><br />\r\n								<span>Troll-Namen sind nicht gestattet. Bitte haltet eine gewisse realistische Namensgebung ein. Au√üerdem darf der Charaktername darf kein Name einer ‚ÄúBer√ºhmtheit‚Äù sein. Auch wollen wir keine sehr bekannten Namen anderer Projekte sehen (Bsp. Ryan Butters, Manfred Lensch, Kurtis Kush). Die Supportleitung beh√§lt sich das Recht vor, den Namen zu √§ndern.</span><br />\r\n								<span>Das Spielen eines nicht vollj√§hrigen Charakters ist nicht gestattet.</span><br />\r\n								<span>Einen 2. Charakter zu erstellen ist fr√ºhestens nach einer Spielzeit von 3 Monaten m√∂glich und dann beim Support zu beantragen.</span><br />\r\n								<span>Wenn der 1. Charakter in einer Gang ist, darf der 2. Charakter nicht ins PD oder in eine andere Gang, andersrum genauso.</span>\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<br />				\r\n				<div style="padding:2px;width:100%;">\r\n					<div class="rules-item">\r\n						<h5>Hinrichtungen, Suizid, Ausreisen</h5>\r\n						<div class="ti-content">\r\n							<div class="ti-text">\r\n								<span>In Absprache mit dem Support k√∂nnt ihr eine Hinrichtung beantragen. Wenn diese genehmigt wurde, d√ºrfen die Mediziner die hingerichteten Spieler nicht behandeln. Der betroffene Charakter wird dar√ºber nicht in Kenntnis gesetzt.</span><br />\r\n								<span>Ebenfalls in Absprache mit dem Support k√∂nnen Ausreiseantr√§ge oder Charakterl√∂schung erfolgen aber nur mit √ºberzeugendem Rp Grund!</span>\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>	\r\n				<br />\r\n				<div style="padding:2px;width:100%;">\r\n					<div class="rules-item">\r\n						<h5>Bewusstlosigkeit (New-Life-Regel)</h5>\r\n						<div class="ti-content">\r\n							<div class="ti-text">\r\n								<span>Wenn du auf dem Boden liegst, kannst du alles h√∂ren und kannst situationsbedingt antworten. Dein Charakter liegt durch eine schmerzverzerrte Animation auf dem Boden. Du bist NICHT bewusstlos!</span><br />\r\n								<span>Sollte kein Mediziner im Dienst sein, kannst du nach Ablauf des Timers beim Krankenhaus respawnen. Gespielte RP-Situation beendet.</span><br />\r\n								<span>Anschlie√üend darfst du dich eine halbe Stunde lang dem Unfallort nicht n√§hern.</span><br />\r\n								<span>Der endg√ºltige Tod kann nur durch eine Hinrichtung oder Suizid erfolgen. Danach wird der Charakter gel√∂scht.</span><br />\r\n								<span>Direkte Racheaktionen sind f√ºr die Person aus dem Krankenhaus nicht erlaubt.</span>									\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<br />\r\n				<div style="padding:2px;width:100%;">\r\n					<div class="rules-item">\r\n						<h5>Geiselnahme, Raub</h5>\r\n						<div class="ti-content">\r\n							<div class="ti-text">\r\n								<span>Bei Geiselnahmen / Raub steht das RP im Vordergrund. So versuche keine √ºbertriebenen Forderungen zu stellen, sondern in einem zumutbaren Verh√§ltnis.</span><br />\r\n								<span>Es m√ºssen <b>5 Polizisten</b> im Dienst sein um Geiselnahmen und einen Raub durchzuf√ºhren. Bleibt fair auch bei kleinen √úberf√§llen.</span>\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<br />\r\n				<div style="padding:2px;width:100%;">\r\n					<div class="rules-item">\r\n						<h5>Gruppierungen, Gangs, Kriege</h5>\r\n						<div class="ti-content">\r\n							<div class="ti-text">\r\n								<span>W√§hrend des Krieges ist jeder Anh√§nger einer Gang verpflichtet, die Farben dieser oder den Kleidungsstil, sichtbar zu tragen</span><br />\r\n								<span>Eine Gruppierung darf aus maximal 15 Personen bestehen.</span><br />\r\n								<span>Ein Gangkrieg kann nur mit vern√ºnftigem RP-Hintergrund und supportseitiger Absegnung entstehen.</span><br />\r\n								<span>Drive-By ist nur w√§hrend des Gangkriegs erlaubt.</span><br />\r\n								<span>Gangs, die sich in einem Krieg befinden, d√ºrfen ohne Schussank√ºndigung auf sich schie√üen. Weichen Zivis nicht aus, nach einer Warnung, z√§hlt es als ‚ÄúKollateralschaden‚Äù Trotzdem wird dazu aufgerufen diese zu vermeiden.)</span><br />\r\n								<span>Ein Ende kann nur entstehen, wenn eine der Parteien aufgegeben hat und anschlie√üend eine R√ºckmeldung an den Support gegeben hat.</span><br />\r\n								<span>Eine Gang darf nicht AKTIV mit einer anderen Gang vorgehen.</span><br />\r\n								<span>Das PD mit einer Gang zu st√ºrmen ist nur erlaubt, wenn es im Support angefragt wird und auch nur dann, wenn die RP-Gr√ºnde dementsprechend schwerwiegend sind.</span>\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<br />\r\n				<div style="padding:2px;width:100%;">\r\n					<div class="rules-item">\r\n						<h5>Sonstiges</h5>\r\n						<div class="ti-content">\r\n							<div class="ti-text">\r\n								<span>Bei Verlust von Items, Autos, etc. muss ein Videobeweis oder aussagekr√§ftigen Screenshots im Support gezeigt werden.</span><br />\r\n								<span>Supportgespr√§che d√ºrfen nicht aufgezeichnet werden.</span><br />\r\n								<span>Bei Regelverst√∂√üen werden vom Support nur Spieler eingebunden, die auch aktiv an dem fehlerhaften RP beteiligt waren.</span><br />\r\n								<span>Die Weitergabe oder gar der Verkauf eines Accounts ist strengstens untersagt.</span><br />\r\n								<span>Das Verkaufen/Handeln von Ingame.W√§hrung gegen W√§hrungen au√üerhalb vom Projekt ist verboten.</span><br />\r\n								<span>Namens√§nderungen bei z.B. einer Hochzeit m√ºssen beim Support angefragt und genehmigt werden.</span><br />\r\n								<span>Es ist dir verboten Streams und Chats anderer Spieler zu verfolgen, w√§hrend zu InGame bist.</span><br />\r\n								<span>Das Streamen und Aufzeichnen von Videos ist auf unserem Server erw√ºnscht und gestattet.</span><br />\r\n								<span>Bilder d√ºrfen keine Teile des HUDs enthalten.</span><br />\r\n								<span>Die Nutzungsrechte am Bild m√ºssen gegeben sein.</span><br />\r\n								<span>Bilder m√ºssen aus der 3rd-Person- oder Ego Perspektive einer weiteren Person entstanden sein.</span><br />\r\n								<span>Die Projektleitung darf ohne Angaben von Gr√ºnden einen permanenten Bann aussprechen.</span>\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>\r\n				<br />\r\n				<div style="padding:2px;width:100%;">\r\n					<div class="rules-item">\r\n						<h5>Ein Appell an alle Spieler</h5>\r\n						<div class="ti-content">\r\n							<div class="ti-text">\r\n								<span><b>Jeglicher Regelbruch MUSS unverz√ºglich beim Support gemeldet werden. Nur so k√∂nnen wir alle am Spielspa√ü profitieren.</b></span><br />\r\n								<span>Bei Fragen √ºber das Regelwerk, steht Euch der Support gerne zur Verf√ºgung.</span>\r\n								</ul>\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>');
